text:
Republicans' failure to reauthorize the Secure Rural Schools Act has cost our rural communities over $48 million. This money is used to keep our schools open – it shouldn't be political. 

@HouseGOP needs to get their act together and fund this program – our kids are counting on it.

https://t.co/1sGaPgVuYA

Job Corps cuts mean losing skilled youth working with orgs like Bend-Redmond Habitat for Humanity to address the housing crisis.

@SecretaryLCD of all people should know how important the program is to Oregon.

Can't say I'm shocked she's not looking out for our best interests... https://t.co/w1DXLTUU0x
